import React, {  useState } from 'react';

function StateExmaple () {
    let [count, setCount] = useState(0);
    let handlerincrement = () => {
        let countplus = count + 1
       setCount(countplus)
    }

    let handlerdncrement = () => {

        let countplus = count - 1
      if(countplus === 0) {
        return count = 0
      }
        
        setCount(countplus)

   
    }
    return (
        <div>
            <button onClick={handlerincrement} className='btn btn-success m-2'>+</button>
            <button onClick={handlerdncrement} className='btn btn-success m-2'>-</button>
            <label>count is: {count} </label>
       
        </div>
    )
}

export default StateExmaple
